                    listOf(r2d(r), r2g(r), r2m(r), r)
                }
                else -> emptyList()
            }
 
            println("%15s  %8s = %10s  %10s  %10s  %10s".format(fa.format(a), units, fc.format(d), fc.format(g), fc.format(m), fc.format(r)))
