fun initMovingAverage(p: Int): (Double) -> Double {
    if (p < 1) throw IllegalArgumentException("Period must be a positive integer")
    val list = mutableListOf<Double>()
    return { 
        list.add(it)
        if (list.size > p) list.removeAt(0)
        list.average()
    }
}
 
