    fun elseNeither(func: () -> Unit): IfBoth {  
        if (!cond1 && !cond2) func()
        return this  // in case it's called out of order
    }
}
 
fun ifBoth(cond1: Boolean, cond2: Boolean, func: () -> Unit): IfBoth {
    if (cond1 && cond2) func()
    return IfBoth(cond1, cond2)
}
 
