    var a = 0
    var b = 1
    ifBoth (a == 1, b == 3) {
        println("a = 1 and b = 3")
    }
    .elseFirst {
        println("a = 1 and b <> 3") 
    }
    .elseSecond {
        println("a <> 1 and b = 3") 
    }
    .elseNeither {
        println("a <> 1 and b <> 3") 
    }
 
    // It's also possible to omit any (or all) of the 'else' clauses or to call them out of order
    a = 1
    b = 0
    ifBoth (a == 1, b == 3) {
        println("a = 1 and b = 3")
    }
    .elseNeither {
        println("a <> 1 and b <> 3") 
    }
    .elseFirst {
        println("a = 1 and b <> 3") 
    }
